import React from "react";
import ProductsItem from "./ProductsItem";

function ProductsList(props) {
   /* {props.arr.map((item) => {
                     <ProductsItem imgLink={item.img_product} name={item.product_name} price={item.price} />
                  })} */
   return (
      <div>
         <div class="product">
            <div class="container">
               <div class="product__block">
                  {props.db.map((item) => {
                     <ProductsItem imgLink={item.img_product} name={item.product_name} price={item.price} />
                  })}

               </div>
            </div>
         </div>
      </div>
   )
}
export default ProductsList
